import React from "react";


function HomeHeader() {
    return (
        <header className="header-name">
            <h2 className="name-en">JOSEPH HOUGHTON</h2>
            <h3 className="name-ja" lang="ja">ジョジョ ホウトン</h3>
        </header>
    );
}

export default HomeHeader;
